        private void CustomOCR()
        {

            var contentJson = System.IO.File.ReadAllText("test.txt");
            var response = JsonConvert.DeserializeObject<GoogleOCRResponse>(contentJson);
            //var mid=response.responses.Where(x=>x.)
            var OCRResponse = response.responses[0].textAnnotations;
            var contentJson1 = System.IO.File.ReadAllText("test1.txt");
            var APIResult = JsonConvert.DeserializeObject<List<ATMCounter.ATMCounterResponse>>(contentJson1);

            var CurrentResponse = APIResult.Where(x => x.recepientName == "ATM Receipt").FirstOrDefault();
            var ExtractedRows = new List<KeyValuePair<string, string>>();
            var newExtractedElement = new List<TextElement>();
            foreach (var item in CurrentResponse.attributeLists)
            {
                foreach (var attritem in item.recieptLabels)
                {
                    string Currentlabel = attritem.rowLabel.Trim();
                    if (Currentlabel.Contains("+"))
                    {

                        Currentlabel = Currentlabel.Replace("+", string.Empty).Trim();
                    }
                    else if (Currentlabel.Contains("="))
                    {
                        Currentlabel = Currentlabel.Replace("=", string.Empty).Trim();
                    }
                    var lbl = Currentlabel.Trim().Split(' ')[0];
                    var CurrentattrList = OCRResponse.Where(x => x.description == lbl).Select(x => x.boundingPoly.vertices.Skip(1).FirstOrDefault());
                    foreach (var cuurentval in CurrentattrList)
                    {
                        var strList = (from t in OCRResponse
                                       where t.boundingPoly.vertices.Skip(1).First().y >= (cuurentval.y - 10) && t.boundingPoly.vertices.Skip(1).First().y <= (cuurentval.y + 10)
                                       select t.description);
                        var currentstring = string.Join(" ", strList);
                        if (attritem.rowLabel.Contains("+"))
                        {
                            currentstring = currentstring.Replace("+", "").Trim();
                        }
                        if (attritem.rowLabel.Contains(item.formLabel))
                        {
                            currentstring = currentstring.Replace(item.formLabel, "").Trim();
                        }
                        var str = currentstring.Replace(attritem.rowLabel.Trim(), "").Trim();
                        //if (attritem.rowLabel.Contains("Date"))
                        //{
                        //    str = str.Replace(" ", string.Empty);
                        //}
                        if (!string.IsNullOrEmpty(attritem.columnLabel))
                        {
                            var spstr = str.Trim().Split(' ');
                            //tr.Add(new KeyValuePair<string, string>(attritem.rowLabel, str));
                            if (spstr.Count() > 0)
                            {
                                ExtractedRows.Add(new KeyValuePair<string, string>(item.formLabel + "==" + attritem.rowLabel, str.Split(' ')[0]));
                            }
                            if (spstr.Count() > 1)
                            {
                                ExtractedRows.Add(new KeyValuePair<string, string>(item.formLabel + "==" + attritem.rowLabel, str.Split(' ')[1]));
                            }
                            if (spstr.Count() > 2)
                            {
                                ExtractedRows.Add(new KeyValuePair<string, string>(item.formLabel + "==" + attritem.rowLabel, str.Split(' ')[2]));
                            }
                            if (spstr.Count() > 3)
                            {
                                ExtractedRows.Add(new KeyValuePair<string, string>(item.formLabel + "==" + attritem.rowLabel, str.Split(' ')[3]));
                            }
                        }
                        else
                        {
                            ExtractedRows.Add(new KeyValuePair<string, string>(item.formLabel + "==" + attritem.rowLabel, str));

                        }
                    }
                }
            }
        }
