        public List<LabelsInfo> GetLabels(ATMCounter.ATMCounterResponse currentAPI)
        {
            var list = new List<LabelsInfo>();

            foreach (var item in currentAPI.attributeLists)
            {
                foreach (var item2 in item.recieptLabels)
                {
                    string label = "";
                    if (item2.rowLabel.Contains('+'))
                    {
                        label = item2.rowLabel.Replace("+", string.Empty).ToUpper();
                    }
                    else if (item2.rowLabel.Contains('='))
                    {
                        label = item2.rowLabel.Replace("=", string.Empty).ToUpper();
                    }
                    else
                    {
                        label = item2.rowLabel.Trim().ToUpper();
                    }

                    if (!list.Any(x => x.RowLable == label && x.ColumnLable == item2.columnLabel))
                    {
                        list.Add(new LabelsInfo()
                        {
                            RowLable = label,
                            ColumnLable = item2.columnLabel
                        });
                    }

                }
            }

            return list;
        }

        public static List<TextElement> ListExtractInformationATMPhysical(List<TextAnnotation> textAnnotations, List<LabelsInfo> rowlabels)
        {
            var possibleKeys = rowlabels;

            string timeRegex = @"([01]\d|2[0-3]):([0-5]\d)";
            string dateTimeRegex = @"\d{2,2}-\d{2,2}-\d{4,4} \d{2,2}:\d{2,2}:\d{2,2}";
            string dateRegx = @"\d{2,2}-\d{2,2}-\d{2,2}";
            string datRegx = "^(([0-9][0-9])\\-([A-Z][a-z][a-z])\\-\\d\\d)$";
            #region Date & Time Extraction
            var wholeTextArray = textAnnotations[0].description.Split(new[] { '\n' }, StringSplitOptions.RemoveEmptyEntries);

            TextElement dateElement = null;
            TextElement timeElement = null;
            foreach (var textItem in wholeTextArray)
            {

                string item = "";

                item = textItem.Replace("Date & Time", string.Empty);
                item = item.Replace("DATE & TIME", string.Empty);
                item = item.Replace("DATE - TIME", string.Empty).Replace("=", string.Empty);
                DateTime dt;
                if (DateTime.TryParseExact(item.Trim(), "dd-MMM-yy HH:mm:ss", System.Globalization.CultureInfo.InvariantCulture,
                                                  System.Globalization.DateTimeStyles.None, out dt))
                {
                    dateElement = new TextElement();
                    dateElement.Label = "DATE - TIME";
                    dateElement.Value = dt.ToString("dd-MMM-yy");
                    timeElement = new TextElement();
                    timeElement.Label = "DATE - TIME";
                    timeElement.Value = dt.ToString("HH:mm:ss");
                }
                else if (Regex.Match(item.Trim(), timeRegex).Success)
                {
                    timeElement = new TextElement();
                    timeElement.Label = "DATE - TIME";
                    timeElement.Value = item.Trim();

                }
                else if (Regex.Match(item.Trim(), datRegx).Success)
                {
                    dateElement = new TextElement();
                    dateElement.Label = "DATE - TIME";
                    dateElement.Value = item.Trim();

                }
                else if (Regex.Match(item.Trim(), dateTimeRegex).Success)
                {
                    dateElement = new TextElement();
                    dateElement.Label = "Date - Time";
                    dateElement.Value = item.Trim();

                }
                if (dateElement != null && timeElement != null)
                {
                    break;
                }

            }


            #endregion

            List<TextElement> elements = new List<TextElement>();

            if (dateElement != null)
                elements.Add(dateElement);
            if (timeElement != null)
                elements.Add(timeElement);


            int index = 1;
            while (index < textAnnotations.Count)
            {
                var textBlock = textAnnotations[index];

                if (index == 70)
                {

                }

                var y1 = textBlock.boundingPoly.vertices[0].y;
                var y2 = textBlock.boundingPoly.vertices[2].y;

                //var x1 = textBlock.boundingPoly.vertices[1].x;
                //var x2 = textBlock.boundingPoly.vertices[3].x;

                var matchingY = Enumerable.ToList(textAnnotations.Where(textB =>
                                                        (textB.boundingPoly.vertices[0].y == y1 && textB.boundingPoly.vertices[2].y == y2) ||
                                                        (Math.Abs(textB.boundingPoly.vertices[0].y - y1) <= 15 && Math.Abs(textB.boundingPoly.vertices[2].y - y2) <= 15))
                                                    .OrderBy(x => x.boundingPoly.vertices[0].x).Distinct());

                //var matchingX = textAnnotations.Where(textB =>
                //                                   (
                //                                       (textB.boundingPoly.vertices[1].x == x1 && textB.boundingPoly.vertices[3].x == x2) ||
                //                                       (Math.Abs(textB.boundingPoly.vertices[1].x - x1) <= 100 && Math.Abs(textB.boundingPoly.vertices[3].x - x2) <= 100)
                //                                   )
                //                                    && textB.boundingPoly.vertices[0].y > y1 && textB.boundingPoly.vertices[2].y > y2)
                //                           .OrderBy(x => x.boundingPoly.vertices[1].y).ToList();



                matchingY = Enumerable.ToList(matchingY.Where(x => x.description != "+" && x.description != "|" && x.description != "L" && x.description != ":" && x.description != "." && x.description != "="));
                if (matchingY.Count <= 0)
                {
                    index++;
                }
                if (string.Equals(textBlock.description, "Type", StringComparison.OrdinalIgnoreCase))
                {
                    index = index + matchingY.Count();
                }

                if (matchingY.Any())
                {
                    var matchingWithIndex = matchingY.Where(x => x.description != "+" && x.description != "=").Select((ax, i) => new { Index = i, Label = ax.description, TextAnnotation = ax });

                    #region Date and Time extract



                    /*if(matchingWithIndex.Any(x=> x.Label == eLabels.DATETIME))
                    {
                        string dateTimeLabelValue = String.Join(" ", matchingY.Select(x => x.description));
                    }*/

                    #endregion

                    TextElement element = new TextElement();
                    TextElement element2 = new TextElement();
                    //var itemsWithValue = matchingWithIndex.Any(x => rowlabels.Contains(x.Label));
                    //var itemsWithValue = matchingWithIndex.Where(x => possibleKeys.Any(y => y==(x.Label.ToUpper()))).ToList();
                    bool check = false;
                    string citem = "";
                    int skipindex = 0;
                    string collbl = "";
                    int colskipindex = 0;
                    int colskipindex2 = 0;
                    foreach (var item in rowlabels)
                    {
                        var val = item.RowLable.Split(' ');
                        var hasvalue = matchingWithIndex.Where(x => x.Label.ToUpper() == val[0]).FirstOrDefault();

                        if (hasvalue != null)
                        {
                            if (val.Length > 1)
                            {
                                hasvalue = matchingWithIndex.Where(x => x.Label.ToUpper() == val[1].Replace(".", string.Empty)).FirstOrDefault();
                                if (hasvalue == null)
                                {
                                    continue;
                                }
                            }
                            check = true;
                            citem = item.RowLable;

                            if (string.IsNullOrEmpty(item.ColumnLable))
                            {
                                if (val.Count() == 1)
                                {
                                    skipindex = 1;
                                }
                                else if (val.Count() == 2)
                                {
                                    skipindex = 2;
                                }
                            }
                            else
                            {
                                var columnvalue = elements.Where(x => x.Label == citem && x.ColumnLabel == item.ColumnLable).FirstOrDefault();
                                if (columnvalue != null)
                                {
                                    continue;
                                }
                                int counter = 0;
                                foreach (var matchings in matchingWithIndex)
                                {
                                    y1 = matchings.TextAnnotation.boundingPoly.vertices[0].y;
                                    y2 = matchings.TextAnnotation.boundingPoly.vertices[2].y;

                                    var x1 = matchings.TextAnnotation.boundingPoly.vertices[1].x;
                                    var x2 = matchings.TextAnnotation.boundingPoly.vertices[3].x;
                                    var ddddd = Enumerable.ToList(textAnnotations.Where(textB =>
