                                                       .OrderBy(x => x.boundingPoly.vertices[1].y));

                                    var colval = ddddd.Where(x => x.description == item.ColumnLable).FirstOrDefault();
                                    if (colval != null)
                                    {
                                        collbl = item.ColumnLable;
                                        skipindex = counter;
                                        break;
                                    }
                                    counter++;
                                }

                            }



                            break;
                        }


                    }

                    //var itemsWithValue = rowlabels.Any(x => matchingWithIndex.Any(y => x.Contains(y.Label)));


                    if (check)
                    {
                        element.Label = citem;// labelItem?.Label;

                        // element.Label = matchingY.FirstOrDefault()?.description?.TryFromEnumStringValue<eLabels>();
                        if (!string.IsNullOrEmpty(collbl))
                        {
                            element.ColumnLabel = collbl;
                        }
                        if (citem == "DATE - TIME")
                        {
                            index++;// = index + matchingY.Count();
                            continue;
                        }

                        else if (citem == "TIME")
                        {
                            index++;// = index + matchingY.Count();
                            continue;
                        }

                        else
                        {
                            element.Value = matchingY.Skip(skipindex).FirstOrDefault()?.description;
                            var nxtIndex = matchingY.Skip(skipindex + 1).FirstOrDefault()?.description;
                            if (nxtIndex != null && nxtIndex == ",")
                            {
                                element.Value = element.Value + matchingY.Skip(skipindex + 1).FirstOrDefault()?.description;

                            }
                        }
                        var currentMatchAdded = false;
                        if (rowlabels.Any(x => x.RowLable.ToUpper().Contains(element.Label.ToUpper())))
                        {
                            elements.Add(element);
                            currentMatchAdded = true;
                        }
                        if (element2?.Value != null && rowlabels.Any(x => x.RowLable.ToUpper().Contains(element.Label.ToUpper())))
                        {
                            elements.Add(element2);
                            currentMatchAdded = true;
                        }

                        //index = index + matchingY.Count();
                        if (currentMatchAdded)
                        {
                            index = index++;// matchingY.Count();
                            foreach (var processed in Enumerable.ToList(matchingY))
                                textAnnotations.Remove(processed);
                        }
                        else
                        {
                            index++;
                        }

                    }
                    else
                    {
                        index++;// = matchingY.Count + index;
                    }
                }

                /*foreach (var vertex in textBlock.boundingPoly.vertices)


                {
                    var xSame = textAnnotations.GroupBy(x => x.boundingPoly.vertices.Where(v => v.y == vertex.y));
                }


                var groupPolys = textAnnotations
                                    .GroupBy(x => x.boundingPoly.vertices

                                                                                    .Where(y => textBlock.boundingPoly.vertices.Any(vextex => y.x == vextex.x && y.y - vextex.y < 20) ||
                                                                                                textBlock.boundingPoly.vertices.Any(vextex => y.y == vextex.y || y.x - vextex.x < 20)).Count() > 0
                                            );*/
                //var groupPolys = textAnnotations
                //                    .GroupBy(x => x.boundingPoly.vertices
                //                                            .Any(vextex => textBlock.boundingPoly.vertices
                //                                                                    .Where(y => (y.x == vextex.x || y.x - vextex.x < 20) ||
                //                                                                                (y.y == vextex.y || y.y - vextex.y < 20) ).Count() > 0)
                //                            );



            }

            return elements;
        }
